import React from 'react'
import '../css/mainContent.css'

class ReviewTableItem extends React.Component {

    constructor(props){
        super(props)
        this.store = {
            type: props.type,
            name: props.name,
            balance: props.balance
        }
    }

    render(){
        return(            
            <tr>
                <td>{this.props.store.type}</td>
                <td>{this.props.store.name}</td>
                <td>${this.props.store.balance}</td>
            </tr>
        )
    }
}

export default ReviewTableItem
